Em ECMAScript 5 (e em algumas implementações de ECMAScript 3), palavras reservadas podem 
ser usadas como nomes de propriedade sem as aspas. Em geral, contudo, os nomes de propriedade 
que são palavras reservadas devem ser colocados entre aspas em ECMAScript 3.
